import Link from 'next/link';



const Index = () => (
    <div className="wrapper">

      <div className="navBar">
      <Link href="/work">WORK</Link>
      </div>

       <div className="navBar">
       <Link href="/about">ABOUT</Link>
       </div>

       <div className="navBar">
     <Link href="/contact">CONTACT</Link> 
     </div>
     
     <p>CONTENIDO HOME</p>

    </div>
  );
  
  export default Index;
